const orders = [
    {
      name: "tgbot1",
      description: "desc",
      id: "123",
      price: "123$"
    },
    {
      name: "tgbot2",
      description: "desc",
      id: "123242343",
      price: "123$"
    },
    {
      name: "tgbot3",
      description: "desc",
      id: "12131223",
      price: "123$"
    }
  ];

function Row(){
    const rows = [];
    for (let i = 0; i < 1000; i++) {
        rows.push(<App {...orders[i]}/>);
    }
    return (rows);
}

export default Row;
